package com.xmy.quotamanage.entity;/** * @author xmy * @date 2021/4/16 2:25 下午 */public class Quota {    private Long quotaId;    private double qcount;    public Quota() {    }    public Quota(Long quotaId, double qcount) {        this.quotaId = quotaId;        this.qcount = qcount;    }    public Long getQuotaId() {        return quotaId;    }    public void setQuotaId(Long quotaId) {        this.quotaId = quotaId;    }    public double getQcount() {        return qcount;    }    public void setQcount(double qcount) {        this.qcount = qcount;    }    @Override    public String toString() {        return "Quota{" +                "quotaId=" + quotaId +                ", qcount=" + qcount +                '}';    }}